export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},eUkJBxGkqE:{data:{id:2210,attributes:{imdbId:"tt2078718",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTkyNjQ0NDk3N15BMl5BanBnXkFtZTgwNDEzNjQ1ODE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.3\u002F10"},{Source:"Rotten Tomatoes",Value:"29%"},{Source:"Metacritic",Value:"23\u002F100"}],item_lang:{data:{id:2873,attributes:{title:c,plot:"Sacrifice is the story of consultant surgeon, Tora Hamilton, who moves with her husband, Duncan, to the remote Shetland Islands, 100 miles off the north-east coast of Scotland. Deep in the peat soil around her new home, Tora discovers the body of a young woman with rune marks carved into her skin and a gaping hole where her heart once beat. Ignoring warnings to leave well alone, Tora uncovers terrifying links to a legend that might never have been confined to the pages of the story-books.",slug:"sacrifice"}}},books:{data:[{id:10832,attributes:{title:c,description:a,thumbnail:a,authors:["Sharon J. Bolton"],firstBook:true,published:"2016-01-01",publisher:"Literacki kryminal",subtitle:a}},{id:10833,attributes:{title:c,description:"For only $6.99: Inspired by an ancient legend, Sharon Bolton's critically acclaimed debut follows the shocking investigation of a decades-long pattern of kidnapping and murder. In this masterful debut that starts off as a mystery and becomes much more, Tora Hamilton is an outsider at her new home on the rocky, windswept Shetland Islands, a hundred miles from the northeastern tip of Scotland. Though her husband grew up here, it’s the first time he’s been back in twenty years. Digging in the peat on their new property, Tora unearths a human body: at first glance a centuries-old bog body, interesting but not uncommon. But realizing that the body is in fact much newer, that the woman’s heart has been cut out and that she was killed within a few days of bearing a child, Tora, herself an obstetrician, becomes obsessed with finding out what happened to her—even when the police, her colleagues, and eventually her husband warn her against getting involved. Reading town records and researching local lore, Tora discovers a disturbing link to ancient Shetland legend and uncovers a collection of deep, dark secrets—the kind of secrets worth killing for. Sacrifice is a bone-chilling, spellbinding debut that will grip readers from its beginning to its startling end. *BONUS CONTENT: This edition of Sacrifice includes a new introduction from the author and a discussion guide",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6VRJAvpSza8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d,"S. J. Bolton"],firstBook:e,published:"2013-02-05",publisher:"Minotaur Books",subtitle:"A Novel"}},{id:10834,attributes:{title:c,description:"En venant s'installer sur cette île sauvage et majestueuse des Shetland, Tora savait qu'elle serait confrontée à un climat rigoureux, à une intégration difficile, et surtout à l'isolement. Mais elle était bien loin d'imaginer qu'elle découvrirait sur ses terres le corps d'une jeune femme, un trou béant à la place du cœur. Un crime que les insulaires semblent pressés d'oublier... Quelque chose pourtant pousse Tora à essayer de comprendre. Pourquoi le meurtrier a-t-il pris le temps de graver des runes sur le corps de sa victime ? Que se passe-t-il sur cette île où d'autres femmes se sont volatilisées ? Pourquoi des pics de mortalité inexpliquée surviennent-ils régulièrement ? Quand une vielle légende locale resurgit, Tora commence à douter qu'elle arrivera un jour à quitter cette île aux disparues...",thumbnail:a,authors:[d],firstBook:e,published:"2009-01-01",publisher:a,subtitle:a}},{id:10835,attributes:{title:"The Night Train",description:"Return to the worlds of The Craftsman and Lacey Flint in this first short story collection from Sharon Bolton, International award-winning author of The Split. This collection features eight short stories, each with a new introduction written by the author as well as the first three chapters of Sharon Bolton's latest novel The Pact. From the world of the Craftsman The Night Train Alive! All Souls' Eve From the world of Lacey Flint Mugwort and Moonbeams Lacey's Wedding From the world of Dead Woman Walking Time Travel, Flight and Invisibility In a world of its own... Mr and Mrs Jansen and the Mermaid And from the world of The Split The Snow Bride",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ek8MEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2021-03-18",publisher:h,subtitle:a}},{id:10836,attributes:{title:"The Pact",description:"'Fast-moving, addictive and thoroughly satisfying,' Jane Casey 'The Secret History for Millennials' Belinda Bauer 'You won't be able to put this book down.' Jo Spain 'Another terrifying, shudder-making, utterly compulsive read' Jill Mansell 'Clever, compelling and unexpected' Rachel Abbott 'So compelling, so addictive' Samantha Downing 'Clever, suspenseful' Cara Hunter 'Horrifying and addictive' Catherine Cooper ********** A golden summer, and six talented friends are looking forward to the brightest of futures - until a daredevil game goes horribly wrong, and a woman and two children are killed. 18-year-old Megan takes the blame, leaving the others free to get on with their lives. In return, they each agree to a 'favour', payable on her release from prison. Twenty years later Megan is free. Let the games begin . . . ********** Richard & Judy bestseller Sharon Bolton is back, with her twistiest thriller yet.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PuQPEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2021-05-01",publisher:h,subtitle:"A dark and compulsive thriller about secrets, privilege and revenge"}}]}}},meta:{}}},prerenderedAt:1682568394836}}("","movie","Sacrifice","Sharon Bolton",null,"series",1,"Hachette UK"))